From walking to the courthouse blasting “This Will Be An Everlasting Love” to the vegan funfetti cake, everything for this day came together perfectly but the aspects that fill us with the most gratitude are all the thoughtful ways our loved ones contributed to our small intimate celebration for such a big life event:

Our families coming to NYC for the weekend- some for the first time! Their generosity with their time and money and love to celebrate us made us feel like the luckiest people 🤍

My mom and sisters making my wedding bouquet of white roses that I picked up from a random store we walked past a few nights before💐 

Our moms and my sisters helping with decorations and details- prepping bud vases, tying bows, steaming my veil. You name it, they were on it! 🎀 

@mollypeachphoto capturing our wedding day SO flawlessly and being our witness AND bringing her super8 camera- it was so special to have such a dear friend capture our day and I couldn’t imagine anyone else doing it (she has now photographed all 3 Gilfillan girls getting married!!) 

@regmarini and @carolinejohnston becoming impromptu super8 wedding videographers for the day with no experience and absolutely nailing it- leaving us with a lifelong treasure 🎥

@bryanjdawley officiating our personal ceremony and including so many personal touches, giving us our ideal way to get married 💒 

@notpaulaabdulnyc doing my makeup and taking her job ✨seriously✨- even coming over to do makeup trials beforehand. I’ve been making her do my makeup since we were 18 and I figured my wedding day should be no different 💅🏻

During our personal ceremony, we did a “blessing of the rings” and had everyone in attendance pass our wedding bands around, sharing good intentions as they held them. Seeing some of that in this video was so special 🥰

@robbairdmusic @regmarini @cam.greve @dgilfillan2 all giving perfect wedding toasts that were all so different from one another 🥂 

Getting to all sit around one table and celebrate was the perfect ending to a perfect day. Thankful to be married to my best friend and thankful that we have such incredible people surrounding us. 🤍🤍🤍
